    public Pokemon getRandomPokemon() {
        int randomIndex = this.random.nextInt(this.pokemons.size());
        return (Pokemon)this.pokemons.get(randomIndex);
    }

    public String getRandomRegion() {
        Set<String> regions = new HashSet();
        Iterator var2 = this.pokemons.iterator();

        while(var2.hasNext()) {
            Pokemon pokemon = (Pokemon)var2.next();
            regions.add(pokemon.getRegion());
        }

        String[] regionArray = (String[])regions.toArray(new String[0]);
        int randomIndex = this.random.nextInt(regionArray.length);
        return regionArray[randomIndex];
    }

    public String getRandomType() {
        Set<String> types = new HashSet();
        Iterator var2 = this.pokemons.iterator();

        while(var2.hasNext()) {
            Pokemon pokemon = (Pokemon)var2.next();
            String[] var4 = pokemon.getTypes();
            int var5 = var4.length;

            for(int var6 = 0; var6 < var5; ++var6) {
                String type = var4[var6];
                types.add(type);
            }
        }

        String[] typeArray = (String[])types.toArray(new String[0]);
        int randomIndex = this.random.nextInt(typeArray.length);
        return typeArray[randomIndex];
    }

