    public boolean isCorrectGuess(String guess, String region, String type) {
        Iterator var4 = this.pokemons.iterator();

        Pokemon pokemon;
        do {
            if (!var4.hasNext()) {
                return false;
            }

            pokemon = (Pokemon)var4.next();
        } while(!pokemon.getName().equalsIgnoreCase(guess) || !pokemon.getRegion().equalsIgnoreCase(region) || !containsType(pokemon, type));

        return true;
    }

    private static boolean containsType(Pokemon pokemon, String type) {
        String[] var2 = pokemon.getTypes();
        int var3 = var2.length;

        for(int var4 = 0; var4 < var3; ++var4) {
            String t = var2[var4];
            if (t.equalsIgnoreCase(type)) {
                return true;
            }
        }

        return false;
    }

    public List<Pokemon> getPokemonWithTypes(String type1, String type2) {
        List<Pokemon> pokemonWithTypes = new ArrayList();
        Iterator var4 = this.pokemons.iterator();

        while(true) {
            Pokemon pokemon;
            String[] types;
            do {
                do {
                    if (!var4.hasNext()) {
                        return pokemonWithTypes;
                    }

                    pokemon = (Pokemon)var4.next();
                    types = pokemon.getTypes();
                } while(types.length != 2);
            } while((!types[0].equalsIgnoreCase(type1) || !types[1].equalsIgnoreCase(type2)) && (!types[0].equalsIgnoreCase(type2) || !types[1].equalsIgnoreCase(type1)));

            pokemonWithTypes.add(pokemon);
        }
    }

    public List<Pokemon> getPokemonWithType(String type) {
        List<Pokemon> pokemonWithType = new ArrayList();
        Iterator var3 = this.pokemons.iterator();

        while(true) {
            while(var3.hasNext()) {
                Pokemon pokemon = (Pokemon)var3.next();
                String[] types = pokemon.getTypes();
                String[] var6 = types;
                int var7 = types.length;

                for(int var8 = 0; var8 < var7; ++var8) {
                    String pokemonType = var6[var8];
                    if (pokemonType.equalsIgnoreCase(type)) {
                        pokemonWithType.add(pokemon);
                        break;
                    }
                }
            }

            return pokemonWithType;
        }
    }

